import "./navbar.css"
function Navbar(){
    return(
        <div className="main-navbar">
            <div className="navbar">
                <center>
                <a className="navbar-link">About</a>
                <h2 className="navbar-head">SIGDI</h2>
                <a className="navbar-link">Contact</a>
                </center>
            </div>
        </div>
    )
}
export default Navbar;
